function Store() {
    return (
        <div className="gap-2 m-6">
            <div className="flex">
                <h1 className="text-2xl font-semibold m-2">Filter</h1>
                <select className="m-2 p-2 rounded-lg shadow-lg bg-slate-500 text-white">
                        <option value="all">All</option>
                        <option value="electronics">Decreasing Price</option>
                        <option value="clothing">Increasing Price</option>
                        <option value="accessories">Accessories</option>
                  </select>
            </div>
            <div className="grid grid-cols-4 gap-3">
                {[
                    Array.from(Array(16)).map((_, index) => (
                        <div
                            key={index}
                            className="p-4 rounded-lg shadow-lg bg-slate-500 min-h-48"
                        >
                            Product {index + 1}
                        </div>
                    )),
                ]}
            </div>
        </div>
    )
}

export default Store
